import React from "react";
import strings from "./strings";
import "./styles.css";

export default function Contact() {
  return (
    <div id="contact-wrapper">
      <div id="contact-form-wrapper">
        <div id="contact-title-wrapper">{strings.getInTouch}</div>
        <div>{strings.firstName}</div>
        <div>{strings.lastName}</div>
        <div>{strings.email}</div>
        <div>{strings.phone}</div>
        <div>{strings.message}</div>
      </div>
      <div id="contact-submit-wrapper">
        <div>{strings.submit}</div>
      </div>
    </div>
  );
}
